#include <stdio.h>
using namespace std;
class TakeSubstringGame{
  public:
  int win[1000001];
  int powerof10[9];
  int winningMove(int n){
    int i;
    int winning=99999999;
    powerof10[0]=1;
    for(i=1;i<=8;i++)powerof10[i]=powerof10[i-1]*10;
    for(i=1;i<=9;i++)win[i]=0;
    for(i=10;i<=n;i++){
      int digit;
      int d1,d2;
      int dec;
      int tmp;
      win[i]=0;
      digit=0;
      tmp=i;
      for(;;){
        if(tmp==0)break;
        tmp/=10;digit++;
      }
      for(d1=0;d1<digit;d1++){
        for(d2=1;d2+d1<=digit;d2++){
          dec=(i/powerof10[d1])%powerof10[d2];
    //      if(dec!=0)printf("move:%d-%d\n",i,dec);
          if(dec!=0 && dec!=i && win[i-dec]==0){
            win[i]=1;
            if(i==n && winning>dec)winning=dec;
          }
        }
      }
    }
    if(win[n]==0)return -1;
    else return winning;
  }
};

